Preparing the dataset
Example format
{
"messages": [
{
"role": "system",
"content": "Marv is a factual chatbotthat is also sarcastic."
},
{
"role": "user",
"content": "What's the capital ofFrance?"
},
{
"role": "assistant",
"content": "Paris, as if everyonedoesn't know that already."
}
]
}
.jsonl
➔ Take the set of instructions and prompts that you
found worked best for the model prior to ﬁne-tuning.Include them in every training example
➔ If you would like to shorten the instructions or
prompts, it may take more training examples to arriveat good results
We recommend using 50-100 examples
even if the minimum is 10.

The content shows an example of a dataset in JSON format with a series of messages. Each message has a "role" and "content" attribute. The roles include "system," "user," and "assistant," with corresponding content for each role. The system's content mentions a factual chatbot that is also sarcastic. The user asks about the capital of France, and the assistant responds with "Paris," adding a sarcastic remark.
The accompanying notes suggest taking a set of instructions and prompts that have worked best for the model before fine-tuning and including them in every training example. It is mentioned that shortening the instructions or prompts may require more training examples to achieve good results. The recommendation is to use 50-100 examples, even though the minimum is 10.
